class Submission:
    submissions = []

    def __init__(self, data):
        self.data = data
        self.status = 'Pending'
        self.submission_id = len(Submission.submissions) + 1

    @classmethod
    def submit(cls, data):
        if cls.is_duplicate(data):
            raise ValueError("Duplicate submission detected.")
        new_submission = cls(data)
        cls.submissions.append(new_submission)
        return new_submission

    @classmethod
    def is_duplicate(cls, data):
        return any(submission.data == data for submission in cls.submissions)

    def update_status(self, new_status):
        self.status = new_status


